import React from "react";

interface Product {
  id: number;
  title: string;
  price: number;
  destination: string;
}

interface ProductCardProps {
  product: Product;
}

const ProductCard: React.FC<ProductCardProps> = ({ product }) => {
  return (
    <div className="product-card">
      <h3>{product.title}</h3>
      <p>{product.destination}</p>
    </div>
  );
};

export default ProductCard;
